;; <=

;; @@
(with-data data
(let [total (nrow ($ :Percent data))
      zero (nrow ($where {:Percent {:lt 1}}))
      complete (nrow ($where {:Percent {:gt 99}}))
      progress(nrow ($where {:Percent {:gt 1 :lt 99}}))]

(print
    " Complete:    " complete ",  %" (int (* 100 (/ complete total)))\newline
    "Didn't start: " zero ",  %" (int (* 100 (/ zero total)))\newline
    "In Progress:  " progress ",  %" (int (* 100 (/ progress total))))

(chart-view (pie-chart ["Zero" "Complete" "In-Progress"] [zero complete progress] :title "MENA"))))
                                     
